      let RTransactionT2Cost = x.RTransactionT2Count > 0 ? x.RTransactionT2Cost / x.RTransactionT2Count : 0;
      this.translate.get('Text_Info_Type2', {
        0: x.RTransactionT2Count,
        2: this.isSafari ? RTransactionT2Cost.toFixed(2) : RTransactionT2Cost.toLocaleString(navigator.language, {
